Episode 7 of the Ranft book club.
-
@virgilabloh has influenced almost every artist whether you know it or not. This book “Icon” released after his passing in 2021 celebrates a very small portion of his large contribution to the creative world. This book primarily focuses on the off white & nike collaboration and offers a behind the scenes look into its creation. However you don’t need to be into sneakers to appreciate the design work on display and the overall impact of this collaboration. Like I mentioned this is just a small piece of Virgil’s legacy which expands into high fashion, music, and art.
